textOriginal:
Agora ele virou ministro da Economia. Vamos ver as atribuições do TSE neste ano:
1. Realizar Censura, incluindo a mando do PT;
2. Realizar Censura Prévia, também a mando do PT;
3. Fornecer transporte gratuito, proibido pela Constituição por considerar compra de votos, também a mando do PT;
4. Fazer Fake News, dizendo que não realiza Censura e nem mesmo está ferindo a Constituição.

Bom, é isso amiguinhos, fiquem bem, fiquem felizes e, no dia 30, não votem em quem ajuda a criar um sistema Censurador e Inconstitucional no Brasil, votem por um país LIVRE.
